const Login = () => {
    return (
        <div className="login_wrapper">
            <form className="form_wrapper">
                <label>이메일</label>
                <input type="email" value onChange />
                <br />
                <label>비밀번호</label>
                <input type="password" value onChange />
                <br />
                <button>로그인</button>
            </form>
        </div>
    );
};

export default Login;
